  return (
    <div className='lg:max-w-5.5xl xl:px-0 px-10 mx-auto pt-14 pb-20 bg-blue-500'>
      <h3 className='text-2xl text-gray-850 font-semibold py-3 mt-5'>
        {title}
      </h3>
      <p className='mb-6 text-gray-750'>{phrase}</p>
      {children}
    </div>
  );
};
